import useFetchData from '../hooks/fetchData';


const Product = () => {

    const { data, error, loading } = useFetchData('products/1');


    console.log(data);
    if(error){
        return(
            <div>
                there was an error
            </div>
        );
    }

    if(loading){
        return(
            <div>
                THE PAGE IS LOADING
            </div>
        )
    }

    // this is the display for the items, its the list
    return (
        <>

            {data}
            {/* {data?.map((product) => {
                return (
                    <div key={product.id}>
                        <p>{product.title}</p>
                        <p>{product.price}</p>

                    </div>
                );
            })} */}
        </>
    );
}


export default Product;
